import './welcome.css';


import React from "react";

import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function Welcome() {


  return (


      <main className='container top1'>

          <div className='row'>

             <Link to='/transactions'>

                 <button className='col-12 border'>
                    <i class="fas fa-house-user button-img green"></i>
                 </button>

            </Link>

          </div>

      </main>    
  );
}

export default Welcome;
